  UNIQUE KEY `decorations_areaID_houseID_unique` (`area_id`),
  UNIQUE KEY `decorations_cityID_houseID_unique` (`city_id`),
  UNIQUE KEY `decorations_subwayID_houseID_unique` (`subway_id`),
  UNIQUE KEY `decorations_characteristicID_houseID_unique` (`characteristic_id`),
  UNIQUE KEY `decorations_collectionID_houseID_unique` (`house_id`,`collection_id`),
  UNIQUE KEY `decorations_deviceID_houseID_unique` (`device_id`),
  UNIQUE KEY `decorations_roomTypeID_houseID_unique` (`room_type_id`),
  UNIQUE KEY `decorations_orientedID_houseID_unique` (`oriented_id`),
  KEY `collection_id` (`collection_id`),
  CONSTRAINT `decorations_ibfk_1` FOREIGN KEY (`area_id`) REFERENCES `areas` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_2` FOREIGN KEY (`city_id`) REFERENCES `cities` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_3` FOREIGN KEY (`subway_id`) REFERENCES `subways` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_4` FOREIGN KEY (`characteristic_id`) REFERENCES `characteristics` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_5` FOREIGN KEY (`house_id`) REFERENCES `houses` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_6` FOREIGN KEY (`device_id`) REFERENCES `devices` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_7` FOREIGN KEY (`room_type_id`) REFERENCES `roomTypes` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_8` FOREIGN KEY (`collection_id`) REFERENCES `collections` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `decorations_ibfk_9` FOREIGN KEY (`oriented_id`) REFERENCES `orienteds` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
